import React, { useState, useEffect } from "react";
import axios from "axios";

const Component1 = () => {
  const [data, setData] = useState("");
  const [loading, setLoading] = useState(true);
  let part = 1;

  const checkNotEmptyUndefinded = (value) => {
    if (value === undefined || value === null || value === "") {
      return false;
    }
    return true;
  };

  let config = {
    method: "get",
    url: `http://localhost:8080/part?id=${part}`,
    headers: {},
  };
  useEffect(() => {
    axios(config)
      .then(function (response) {
        setData(response.data);
        setLoading(false);
      })
      .catch(function (error) {
        console.log(error);
      });
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  const generateLine = (val) => {
    let returnedValue = "";
    Object.entries(val).forEach(([key, value]) => {
      if (typeof value === "object" && checkNotEmptyUndefinded(value)) {
        generateLine(value);
      } else {
        returnedValue = `
          <div>
            <span>${key}</span>
            <span>${value}</span>
          </div>`;
      }
    });
    return returnedValue;
  };

  !loading
    ? // ? generateLine(data)
      Object.entries(data).forEach(([key, value]) => {
        console.log("E-1 KEYS", key);

        if (typeof value === "object") {
          Object.entries(value).forEach(([key2, value2]) => {
            console.log("E---2 KEYS2", key2);

            if (typeof value2 === "object") {
              Object.entries(value2).forEach(([key3, value3]) => {
                console.log("E-----3 KEYS3", key3);

                if (typeof value3 === "object") {
                  Object.entries(value3).forEach(([key4, value4]) => {
                    console.log("E---------4 KEYS4", key4);
                    console.log("E---------4 VALUES4", value4);
                    console.log("E---------4 VALUES4 TYPE", typeof value4);
                  });
                } else {
                  console.log("E-----3 VALUES3", value3);
                  console.log("E-----3 VALUES3 TYPE", typeof value3);
                }

                // console.log("E-----3 VALUES2", value3);
                // console.log("E-----3 VALUES2 TYPE", typeof value3);
              });
            } else {
              console.log("E---2 VALUES2", value2);
              console.log("E---2 VALUES2 TYPE", typeof value2);
            }
          });
        } else {
          console.log("E-1 VALUES", value);
          console.log("E-1 VALUES TYPE", typeof value);
        }
        console.log("");
      })
    : console.log("loading");

  return (
    <>
      {loading ? (
        <div>Loading...</div>
      ) : (
        <div>
          {/* <div>Kind: {<ExplodePart part={Kind} />}</div> */}
          {/* <div>Spec: {<ExplodePart part={data?.spec} />}</div> */}
          <div>Status:</div>
          <div>Metadata:</div>
          <div>APIVersion:</div>
          {/* {data?.map((item, index) => (
            <div key={index}>
              <h1>{item.name}</h1>
              <p>{item.description}</p>
            </div>
          ))} */}
        </div>
      )}
    </>
  );
};
